import web from "../Images/d0a103.png";

const Project = () => {
  return (
    <>
      <div className="my-5">
        {" "}
        <h1 className="text-center"> My Projects</h1>
      </div>

      <div className="container-fluid mb-5">
        <div className="row">
          <div className="col-10 mx-auto">
            <div className="row gy-4">
              <Card />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Project;
